import React from 'react';

export default function Refrencias (){

    const handleToggleMenu = (e) => {
        const $menu =document.getElementById("menu");

        if(e.taget.textContent === "Menú"){
            e.target.textContent = "Center";
            $menu.style.display = "block"
        }else{
            e.target.textContent = "Menú";
            $menu.style.display = "none"
        }
    }

    return(
        <>
            <h2>Referencias</h2>
            <button id="menu-btn" onClick="handleToggleMenu">Menú</button>
            <nav id="menu" style={{display:"none"}}>
                <a href="#">Sección 1</a><br/>
                <a href="#">Sección 2</a><br/>
                <a href="#">Sección 3</a><br/>
                <a href="#">Sección 4</a><br/>
                <a href="#">Sección 5</a>
            </nav>
        </>
    )
}
